import React from "react";
import Tilt from "react-parallax-tilt";


function Logo() {
  return (
    <div className="ma4">
      <Tilt className="Tilt"options={{ max: 25 }}
        style={{ height: 250, width: 250 }}
      >
          <h1>React Parallax Tilt</h1>
      </Tilt>
    </div>
  );
}

export default Logo;
